function hexToRgb(hex) {
	let result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
	let colors = [];
	colors[0] = parseInt(result[1], 16);
	colors[1] = parseInt(result[2], 16);
	colors[2] = parseInt(result[3], 16);

	return colors;
}

export function Initialize() {
	SendInitializationPacket();
	SendToggleLightingPacket(1);
	SetMode();
}


export function Shutdown() {
	SendToggleLightingPacket(0);
}

export function LedNames() {
	return vKeyNames;
}

export function LedPositions() {
	return vKeyPositions;
}

export function Render() {
	sendColors();
}


function sendColors(shutdown = false){

	let RGBData = new Array(14 * 4).fill(0);

	for(let iIdx = 0; iIdx < vKeyPositions.length; iIdx++) {
		let iPxX = vKeyPositions[iIdx][0];
		let iPxY = vKeyPositions[iIdx][1];
		var col;

		if(shutdown){
			col = hexToRgb(shutdownColor);
		}else if (LightingMode === "Forced") {
			col = hexToRgb(forcedColor);
		}else{
			col = device.color(iPxX, iPxY);
		}

		RGBData[iIdx * 4];
		RGBData[iIdx * 4 + 1] = col[0];
		RGBData[iIdx * 4 + 2] = col[1];
		RGBData[iIdx * 4 + 3] = col[2];
	}

	SendDirectModePacket(RGBData);

}


function SendDirectModePacket(data){
	let packet = [0x00, 0x5A, 0x3A, 0x15, 0x0A, 0x00, 0x03, 0xFF, 0x02];
	packet = packet.concat(data);

	device.write(packet, 65);
	//device.get_report([0x00], 64)
	SendCommit(0xFF, 0x02, data.length);
}


function SendColorPalette(){
	let packet = [0x5A, 0x3A, 0x21, 0x0a, 0x00, 0x04, 0x01, 0x01];

	for(let iIdx = 0; iIdx < 11; iIdx++){
		let LedOffset = 7 + iIdx * 3;
		packet[LedOffset + 1] = 0xFF;
		packet[LedOffset + 2] = 0xFF;
		packet[LedOffset + 3] = 0xFF;
	}

	device.write(packet, 65);
}

