function SendInitializationPacket(){
	let packet = [0x00, 0x5A, 0x3A, 0x36, 0x04, 0x00, 0x03, 0x01];

	for(let i = 8; i < 58;i++){
		packet[i] = 0x02;
	}

	device.write(packet, 65);
	//device.get_report([0x00], 64)
}

function SendToggleLightingPacket(enable){
	let packet = [0x00, 0x5A, 0x3A, 0x02, 0x06, enable];
	device.write(packet, 65);
	//device.get_report([0x00], 64)
}


//00 5a 3a 09 0a 00 03 01 01 ff 00 00 ff
function SetMode(){
	let packet = [0x00, 0x5A, 0x3A, 0x09, 0x0A, 0x00, 0x03, 0xFF, 0x01, 0xFF, 0xFF, 0xFF, 0xFF];
	device.write(packet, 65);
	//device.get_report([0x00], 64)

	SendCommit(0xFF, 2, 1);
}

//00 5a 3a 06 0b 00 03 01 01 01
function SendCommit(mode, subMode, dataSize){
	let packet = [0x00, 0x5A, 0x3A, 0x06, 0x0B, 0x00, 0x03, mode, subMode, dataSize];
	device.write(packet, 65);
	//device.get_report([0x00], 64)
}
